import React, { Component } from "react";

class Membro extends Component{

    constructor(props){
        super(props);
        this.state = {
            nome: props.nome
        }
    }

    render(){
        return(
            <div>
                {this.props.nome}
            </div>
        );
    }
}

export default Membro;
